import {
	get,
	each,
	has,
	die,
	getArchtype,
	ImmerState,
	Patch,
	ProxyType,
	SetState,
	ES5ArrayState,
	ProxyArrayState,
	MapState,
	ES5ObjectState,
	ProxyObjectState,
	Archtype,
	isMap,
	isSet
} from "./internal"

export type PatchPath = (string | number)[]

export function generatePatches(
	state: ImmerState,
	basePath: PatchPath,
	patches: Patch[],
	inversePatches: Patch[]
): void {
	switch (state.type) {
