function generateSetPatches(
	state: SetState,
	basePath: PatchPath,
	patches: Patch[],
	inversePatches: Patch[]
) {
	let {base, copy} = state

	let i = 0
	base.forEach(value => {
		if (!copy!.has(value)) {
			const path = basePath.concat([i])
			patches.push({
				op: "remove",
				path,
				value
			})
			inversePatches.unshift({
				op: "add",
				path,
				value
			})
		}
		i++
	})
	i = 0
	copy!.forEach(value => {
		if (!base.has(value)) {
			const path = basePath.concat([i])
			patches.push({
				op: "add",
				path,
				value
			})
			inversePatches.unshift({
				op: "remove",
				path,
				value
			})
		}
		i++
	})
}

export function applyPatches<T>(draft: T, patches: Patch[]): T {
	patches.forEach(patch => {
		const {path, op} = patch

		/* istanbul ignore next */
		if (!path.length) die()

